import React, { Component } from "react";
import JwtClient from "./Controlers/Jwt.controler.js";

class App extends Component {
    constructor(props) {
        super(props);
        this.jwtClient = new JwtClient();

        this.state = {
            token: "no token",
        };
    }

    render() {
        return (
            <div className="App">
                <label>{this.state.token}</label>

                <button
                    onClick={() => {
                        this.jwtClient.authenticate("admin", "admin").then(
                            this.setState({
                                token: this.state.jwtClient.getToken(),
                            })
                        );
                    }}
                >
                    It hurts
                </button>
            </div>
        );
    }
}

export default App;
